;
; hit_detected = 0;
;
	lda     #$00
	sta     _hit_detected
;
; pad1 = pad_poll(1);     // read the first controller
;
	lda     #$01
	jsr     _pad_poll
	sta     _pad1
;
; pad1_new = get_pad_new(1); // newly pressed button. do pad_poll first
;
	lda     #$01
	jsr     _get_pad_new
	sta     _pad1_new
;
; zapper_ready = pad1_zapper ^ 1; // XOR last frame, make sure not held down still
;
	lda     _pad1_zapper
	eor     #$01
	sta     _zapper_ready
;
; pad1_zapper = zap_shoot(0);   // controller slot 2
;
	lda     #$00
	jsr     _zap_shoot
	sta     _pad1_zapper
;
; trigger_pulled = (pad1 & PAD_B) || (pad1 & PAD_A) || zap_shoot(0);                // controller slot 1 zapper
;
	lda     _pad1
	and     #$40
	bne     LDE1C
	lda     _pad1
	and     #$80
	bne     LDE1C
	jsr     _zap_shoot
	tax
	beq     LDE1D
LDE1C:	lda     #$01
LDE1D:	sta     _trigger_pulled
;
; trigger_clicked = (pad1_new & PAD_A) || (pad1_new & PAD_B) || ((pad1_zapper) && (zapper_ready)); // needs to check last frame for blank
;
	lda     _pad1_new
	and     #$80
	bne     LDE23
	lda     _pad1_new
	and     #$40
	bne     LDE23
	lda     _pad1_zapper
	beq     LDE24
	lda     _zapper_ready
	beq     LDE24
LDE23:	lda     #$01
LDE24:	sta     _trigger_clicked
;
; if ((pad1_zapper) && (zapper_ready))
;
	lda     _pad1_zapper
	beq     LDD7E
	lda     _zapper_ready
	beq     LDD7E
;
; hit_detected = zap_read(0);
;
	lda     #$00
	jsr     _zap_read
	sta     _hit_detected
;
; if (debug_mode && hit_detected == 0)
;
LDD7E:	lda     _debug_mode
	beq     LDD89
	lda     _hit_detected
	beq     LDE28
LDD89:	rts
;
; hit_detected = (pad1 & PAD_A);
;
LDE28:	lda     _pad1
	and     #$80
	sta     _hit_detected
;
; }
;
	rts

